import React from "react";


const PlaceHolder = () => {

return (
    <div className="Placeholder">
        <h1 className="PlaceholderHeading">Uh Oh...</h1>
        <p className="PlaceholderText">Unfortunately, Mason has not finished developing his <em>Project Viewer React Application.</em><br/>He promises that he is working hard and will have it done shortly.<br/>If interested, please feel free to check back whenever you would like.<br/>It will be worth the wait... :)</p>
    </div>
)
}

export default PlaceHolder;
